import React from 'react';
import styled from 'styled-components';

const Board = () => {
  return (
    <div>
      <h1>Board</h1>
    </div>
  );
};

Board.getInitialProps = context => {
  context.store.dispatch({
    type: LOAD_BOARDS_REQUEST,
  });
};

export default Board;
